8:45  In chambers - Defendant Duane A Gamez with Attorney Michael Hughes.  ADA Crystal Long for the State of Wisconsin.  Discussion on search; stipulation signed.  Discussion re: convictions; # agreed upon.  Witness sequestration granted w/exception of court officer Ben Ziegler.  Welcome instructions reviewed.  Note-taking and allowance of juror questions not permitted.  Court in recess 9:30/9:42 Court resumed - appearances the same; Bailiffs: Bill Schleichert and Helen Hunter; Court called, appearances stated, 34 jurors summoned, 1 dismissed, 1 no show, 1 late arrival; Court's opening remarks to jurors, potential jurors sworn, 20 jurors seated
Court questioned potential jurors; 10:00 sidebar, Potential juror #1 excused, new juror #1 seated, questioning cont'd; 10:09 Attorney Long questioned potential jurors; 10:16 Attorney Hughes questioned potential jurors;
10:24 Peremptory strikes used; 10:28 sidebar; 10:29 12 Jurors selected, jury sworn, potential jurors released, sworn jury removed from the courtroom; reasons for sidebars put on the record, 10:39 Court in recess. 10:51 A.M., Court back in session, appearances the same, 10:54 A.M. Jury brought back in, Court goes over opening instructions w/the Jury, 11:09 A.M. Atty Long makes opening statement, 11:12 A.M. Atty Hughes makes opening statement, Court goes over agreement re: lawful search, 11:16 A.M. State calls Witness Brett Gerritson, Columbus Police Department, sworn, 11:17 A.M. Direct Exam by Atty Long, Exhibit #1, Bag of Marijuana, THC, marked by Atty Long, 11:23 A.M. Cross exam by Atty Hughes, 11:25 A.M. Redirect by Atty Long, 11:25 A.M. Witness excused, State calls witness Officer Benjamin Ziegler, Columbus Police Department, sworn, 11:26 A.M., Direct exam by Atty Long, Exhibits, #2, #3, #4, marked by Atty Long, Exhibits #1, #2, #3, and #4 offered and received, 11:35 A.M. Cross exam by Atty Hughes, 11:35 A.M. Witness excused, State calls witness Martin Koch, Wisconsin State Crime Lab Analyst, sworn, 11:37 A.M. Direct exam by Atty Long, Exhibit #5 marked, offered and received, 11:46 A.M. Cross exam by Atty Hughes, 11:47 A.M. Witness excused, State calls Witness Lt. Dennis Weiner, Columbus Police Dept., sworn, 11:49 A.M. Direct exam by Atty Long, Exhibit #6 marked by Atty Long, 11:58 A.M. Cross exam by Atty Hughes, 11:59 A.M. Witness excused, Exhibit #6 offered and received, 12:00 P.M. Jury excused, Atty Long submitting Certified JOC in 11 CF 245, not an exhibit to be shown to the jury, Court receives, Court in recess at 12:05 P.M. Court back in session at 12:58 P.M. appearances the same, Certified JOC marked at Exhibit #7, Court goes over defendant's rights to testify, Defendant states he will not testify, Court accepts defendant's right not to testify, knowingly, freely and voluntarily, Court goes over jury instructions w/counsel, counsel agrees with instructions, 1:22 P.M. Jurors return, State and Defense rest, 1:24 P.M., Court goes over jury instructions w/the jurors, 1:35 P.M. Atty Long gives closing argument, 1:43 Atty Hughes gives closing argument, 1:58 P.M. Rebuttal by Atty Long, 2:03 P.M. Court continues instructions to the jurors, 2:06 P.M. Bailiff's sworn, 2:06 P.M. Jurors excused for deliberation, Counsel has no objection to verdict forms, Court in recess at 2:12 P.M. Court back in session at 3:50 P.M., appearances the same, the jurors have a verdict, 3:51 P.M. Jurors brought back, Defendant found guilty of Ct. 1, jurors polled, 3:56 P.M. Jurors excused, Atty Long requesting Court to entered Judgment, Court enters Judgment on Ct. 1, Atty Long requesting Pre-Sentencing Investigation, Court orders Pre-Sentence Investigation, to be conducted w/in 60 days, Sentencing to be set after 60 days w/Br. 2 JA, bond cont'd, 4:01 P.M.
